import React from 'react'
import './Filter.css'


function Filter(props) {
    function handle(){
        let ele = document.getElementById(props.name);
        if(ele.checked){
            console.log(props.name);
        }
    } 
    return (
        <div className = "Filter">
            <input type="checkbox" value={props.name} id={props.name} onChange={handle}></input>
            <label for={props.name}>{props.name}</label>            
        </div>
    )
}
export default Filter;
